import React from "react";
import { Nav, Row, Col } from "rsuite";

const LeftNav = () => {
  const contentStyles = {
      width: "10rem"
  };
  const NavContents = ({active, onSelect, ...props}) => {
    return (
      <Nav {...props} vertical activeKey={active} onSelect={onSelect} style={contentStyles}>
        <Nav.Item>Home</Nav.Item>
        <Nav.Item>Project One</Nav.Item>
        <Nav.Item>Project Two</Nav.Item>
      </Nav>
    );
  };

  return <NavContents  appearance="tabs"/>;
};

export default LeftNav;
